      | 34266 -> { ItemTypeData.id= 34266; name= "Small Higgs Anchor I"; published= true; description= "This unique rig generates drag against the energy field of space itself, causing the fitted ship to increase in mass and agility while greatly reducing maximum velocity.  This effect also reduces a ship's maximum warp speed, although the impact on warp velocity can be mitigated through skilled use. As a side effect of the increased warp drag, interdiction nullified ships lose the benefits of their nullification while fitted with this rig, causing them to be affected by non-targeted warp disruption like normal vessels.    The drawbacks of fitting this rig may be reduced by training the <a href=showinfo:26254>Astronautics Rigging</a> skill.  Only one Higgs Anchor can be fitted at a time.    Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized."; marketGroupId= Some(1210); groupId= 1308; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 1547; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1153; value= 25.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 100.000000 }; { DogmaAttributeValueData.attributeId = 1539; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 200.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 5.000000 }; { DogmaAttributeValueData.attributeId = 1544; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 1131; value= 100.000000 }; { DogmaAttributeValueData.attributeId = 1138; value= -10.000000 }; { DogmaAttributeValueData.attributeId = 151; value= -55.000000 }; { DogmaAttributeValueData.attributeId = 633; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 315; value= -75.000000 } |]; dogmaEffects= [| { DogmaEf