      | 353881 -> { ItemTypeData.id= 353881; name= "DUST Prometheus"; published= false; description= "The dropship is a two-engine VTOL craft that combines advances in shielded hardware, redundant software protocols, and networked aeronautics into a heavily armored tactical platform capable of insertion and extraction in even the most hostile situations. Its standard five-man carrying capacity, dual hardpoints, and reinforced plating allow it to operate independently in any situation, alternately tracking and engaging enemy targets and ferrying troops into and out of harm's way.    The Logistics class is the ultimate troop transport. A vehicle that, thanks to its on-board Clone Reanimation Unit (CRU), redefines the notion of frontline troop insertion."; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
