      | 355821 -> { ItemTypeData.id= 355821; name= "Assault Heavy Machine Gun"; published= false; description= "A multi-barrel, rotary drive machine gun, the HMG is a singularly devastating anti-infantry weapon. Eschewing the advantages of a lighter frame in favor of stopping power, the exponentially increased heat and vibration produced by this Boundless Creation developed weapon makes it almost unbearable to fire. Yet despite this fact, its above average hit ratio and extreme rate of fire has earned it the nickname “Death's Engine.”  Unlike earlier models, the weapon requires no spool up time; rounds are expelled the instant the trigger is pressed. This comes at the cost of initially reduced accuracy as the counter-rotating drives slowly align. Once fully aligned, however, the HMG produces a pinpoint stream of gunfire with unmatched killing potential."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356015 -> { ItemTypeData.id= 356015; name= "'Primordial' Militia Caldari Medium Frame"; published= false; description= "A basic dropsuit frame hardwired with all minimum designation combat suites and protocols but without any role-specific customizations.    NOTE: This basic frame does not receive any role-specific bonuses."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356112 -> { ItemTypeData.id= 356112; name= "'Raven' Logistics M-I"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.  Utilizing a combination of high- and low-tech equipment, operators of the logistics suit are able to make effective repairs to installations, vehicles, and even other soldiers; every apparatus required for field triage is present and easily accessible from the utility pockets and satchels attached to the suit. Its hydraulic assisted exoskeleton allows the wearer to effortlessly hoist heavy equipment, while the helmet is packed with material scanners sensitive enough to spot microfractures in layered steel.  When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 35624 -> { ItemTypeData.id= 35624; name= "Vargur Nefantar SKIN (365 Days)"; published= true; description= ""; marketGroupId= None; groupId= 1955; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 356306 -> { ItemTypeData.id= 356306; name= "Wiyrkomi Triage Nanohive"; published= false; description= "The nanohive is one of the most advanced pieces of battlefield technology to date, able to convert formatted matter from its limited internal stores and reorganize it into any kind of ammunition. When a soldier approaches, the nanohive receives an automated request from the Cortex Holographic Interface instructing swarms of self-replicating construction nanites to begin producing whatever type of ammunition that soldier requires.  The device itself is composed of three major parts: a composite carbon polymer shell, heavily shielded to prevent potentially disruptive ambient electronic interference; a low-level replicator assembly housing the initial seed swarm; and a C11 power core capable of producing class-one containment fields, confining the nanite swarm as it replicates to its maximum sustainable mass. There is, however, no central computer; each nanite is born with a complete set of instructions on how to create every known variety of ammunition round."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
