      | 366491 -> { ItemTypeData.id= 366491; name= "State Assault C/1-Series"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  A flat-coil e5000 fifth generation fusion core runs up the inside of the back plate, powering the entire suit. Its output and heat buildup are controlled by a L2 “Gatekeeper” regulator conduit, which connects directly to the sensor system at the base of the neck. Every joint is reinforced with kinetic sensors and two-way, high torque servos to enhance the soldier’s strength, balance, and resistance to impact forces. The suit’s helmet has more integrated sensor, communication, targeting, and data processing systems than most civilian vehicles. As is common with Caldari designs, armor plating is limited to vital areas, relying instead on high-power shield systems to protect the wearer.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366685 -> { ItemTypeData.id= 366685; name= "'Neo' Sentinel ck.0"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Designed for maximum energy absorption, the Caldari Sentinel’s shielding system features an elevated saturation threshold, allowing it to dissipate a greater amount of energy in order to maintain overall shield integrity. Additionally, highly efficient refraction systems make subtle adjustments to the overlapping fields that comprise the shielding surface area, diverting minute amounts of incoming energy and dampening the effective damage of certain small arms fire.    Heavy dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
