      | 48816 -> { ItemTypeData.id= 48816; name= "Tengu Storm Bear SKIN"; published= true; description= "Caldari Prime's climate is renowned for being colder than most temperate worlds, but the large polar and subpolar regions are frigid indeed. The huge swathes of territory circled around the poles contain various biomes, including vast tundras, but the taigas of the subpolar belts are iconic in Caldari culture and mythology. The most charismatic of the fauna inhabiting these belts are the great bears of Caldari Prime. In the northern taiga, the Storm Bear reigns supreme, a creature larger than any other predator save the Emperor Bears of the southern polar archipelagos.    The realm of the Storm Bear is far more mountainous than the southern islands and is known for the sky-wracking storms that sweep the forested slopes of the region. The Storm Bear, also called  Thunder Bear  in some Caldari animist traditions, takes its name from its rain-cloud grey pelt and its complete fearlessness, even in the face of the wind, rain and lightning of the greatest mountain storms."; marketGroupId= Some(2370); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
