      | 52890 -> { ItemTypeData.id= 52890; name= "Typhoon Fleet Issue Snowline Bladeracer SKIN"; published= true; description= "In the icy climes of the Northern Mikramurka on Matar there are many traditional forms of transport that take advantage of the snow and ice fields to be found there. One of the most celebrated is still found as a traditional sport around the seismically active western interior of that region.    The  bladeracer  sled competitions are usually held on the relatively gentle slopes of the dormant shield volcanoes typically found in the area. The climate means that the upper reaches of the volcanoes are covered in snow and ice all year round but the lower areas remain rather fertile and are warmed by vents. The consequent profusion of heathers and mosses give the hills and slopes their characteristic purple coloration during the  warm  season."; marketGroupId= Some(2108); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
