      | 53957 -> { ItemTypeData.id= 53957; name= "Hecate Heartsurge SKIN"; published= true; description= "Noting the success of holoreels starring actors using Impetus's Glamourex neural booster, the Nugoeihuvi Corporation sought to develop a similar product, albeit one placing greater emphasis on boosting base sex appeal rather than a more subtle charismatic charm. The Heartsurge project was farmed out to one of the giant NOH megacorp's many subsidiaries, Bakkomolu Productions, which in turn contracted with a neurotweaker lab based in the Mivora constellation, on the edges of the Forge region. Progress on the development of Heartsurge was so promising that Bakkomolu commissioned the nanodesigner Jovaa Seriazic to produce a series of promotional ship nanocoatings.    When Bakkomolu Productions was dissolved following a legal dispute with NOH's corporate rival Wiyrkomi, Nugoeihuvi may have hoped to generate a return from the new Heartsurge booster. Unfortunately, the neurotweaker lab had disappeared leaving behind only a scattering of circumstantial evidence that it was an Angel Cartel front all along. This theory was later confirmed when Heartsurge began to be used by producers of black market holoreel titles linked to the infamous Cartel. For his part, with Bakkomolu's dissolution creating a breach of contract, Jovaa Seriazic made some profit on his nanodesign work by selling the license for the nanocoatings to the Serpentis Corporation."; marketGroupId= Some(2356); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
