      | 54733 -> { ItemTypeData.id= 54733; name= "Thunderchild"; published= true; description= "The <i>Thunderchild</i>-class battleship was commissioned from Upwell by the New Eden Common Defense Initiative while the organization was still a counter-Triglavian strategy group headed by Provost Marshal Kasiha Valkanir. When EDENCOM was officially announced as the new central command for the defense of New Eden in YC122, the research and development of a line of ships capable of bearing radical new weaponry was widely rumored following Triglavian raids on Upwell development facilities.    The Upwell Consortium had been working on adapting Arcing Vorton Projector weaponry to a ship-based form since the success of the technology as an anti-fleet weapon on Keepstar Citadels. The first Triglavian invasions in mid-YC121 spurred that effort on even before EDENCOM underwrote the project, providing access to scientists and engineers from the secret weapons programs of the four core empires, and even the SoCT.    The <i>Thunderchild</i>-class was conceived as the striking fist of counter-Triglavian fleets when commissioned by EDENCOM. This battleship is oriented around maximum firepower with high-output, rapid-charging Arcing Vorton Projectors delivering a blizzard of arc strikes against squadrons of enemy ships."; marketGroupId= Some(1379); groupId= 27; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 1547; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 129; value= 1000.000000 }; { DogmaAttributeValueData.attributeId = 1154; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 3; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 102141000.000000 }; { DogmaAttributeValueData.attributeId = 662; value= 0.500000 }; { DogmaAttributeValueData.attributeId = 263; value= 13500.000000 }; { DogmaAttributeValueData.attributeId = 136; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 6600.000000 }; { DogmaAttributeValueDat